San Giorgio della Richinvelda (Standard Friulian: San Zorç da la Richinvelde;
Western Friulian: San 'Sors) is a comune (municipality) in the Province of Pordenone in the Italian region Friuli-Venezia Giulia, located about 90 kilometres (56 mi) northwest of Trieste and about 20 kilometres (12 mi) northeast of Pordenone. It has a population of 4,626 inhabitants divided in the seven small towns that compose the municipality: Rauscedo, Domanins, Cosa, Pozzo, Provesano, Aurava and San Giorgio. 
Agriculture represents the most common activity of the territory. Rauscedo has been at the top in the world for the farming of 'barbatelle', which are the plants from which wine is obtained.
